export default function Nav(){

  const x = document.querySelector('.nav--image')
    const ul = document.querySelector('nav--ul')

    function display(){
        if (x.style.display === "none"){
            x.style.display = "flex"
        }
        if (ul.style.display === "none"){
            ul.style.display = "flex"
        }
    }


return(
<div className="nav">
<div className="nav--image-title">
<img Onclick={this.style.display="none"? this.style.display="flex":this.style.display="none"} src="/images/icon-hamburger.svg" alt="hamburger icon" className="nav--hamburger" />
<nav className="nav--Title">room</nav>
</div>
<ul className="nav--ul">

<img  src="/images/icon-close.svg" alt="x"  className="nav--image" />

<li className="nav--List">home</li>
<li className="nav--List">shop</li>
<li className="nav--List">about</li>
<li className="nav--List">contact</li>

</ul>
</div>
)
}
